  true,\n\t\"url\": null,\n\t\"notes\": \"Installation of aftermarket airbag control
  switches or permanent deactivation of passenger vehicle airbags.  The program began
  in 1998, and will end in 2012, when all new vehicles will be required to contain
  smart airbags NHTSA developed a database to track vehicles with disconnected airbags,
  but It was retired m 2006 when funding was cut NHTSA IS now developing a spreadsheet
  to track this information. Initially, Congress requested reports on the program
  but no longer does so. NHTSA produces weekly statistical reports on requests received
  and answered.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
